const styles = {
    container: {
        textAlign: 'left',
    },
    text: {
        color: 'white',
        fontSize: '15px',
    },
}

function AboutMe() {
    return(
        <div style={styles.container}>
            <p style={styles.text}>
                I am a junior studying Computer Science student at Texas A&M University with a minor in Statistic and Cybersecurity.
            </p>
        </div>
    );
}

export default AboutMe;
